import { Dialog, withStyles, Box, Typography, makeStyles, List, ListItem } from "@material-ui/core";

const useStyles = makeStyles ({
    component: {

    },
    lefComponent: {

    },
})

const style = {
    dialogPaper:{
        height: '95%',
        width: '100%',
        marginTop: '12%',
        boxShadow: 'none',
        borderRadius: 0,
    }
}

const Login = ({classes}) => {
    const classname = useStyles();
    const qrUrl = 'http://www.ginifab.com/feeds/qr_code/img/qrcode.jpg';
    return(
        <Dialog 
        open={true} 
        classes={{ paper: classes.dialogPaper}}
        BackdropProps={{style: {backgroundColor: 'unset'}}} >
            <Box>
                <Typography>Dang nhap bang What Apps</Typography>
                <List>
                    <ListItem>1. Mở What Apps trên điện thoại của bạn</ListItem>
                    <ListItem>2. Chọn Menu hoặc Cài đặt và chọn Kết nối thiết bị</ListItem>
                    <ListItem>3. Đưa điện thoại ra trước màn hình và quét</ListItem>
                </List>
            </Box>
            <Box>
                <img src={qrUrl} alt='qr'/>
            </Box>
        </Dialog>
    )
}

export default withStyles(style)(Login);
